sys_script_include.script:
var ReportUtils = Class.create();
ReportUtils.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {

    getLatestSubmission: function() {
        var submission = new GlideRecord('x_424363_ski_eva_1_submission');
        submission.orderByDesc('sys_created_on');
        submission.setLimit(1);

        submission.query();
        if (submission.next())
            return submission;

        return '';
    },

    type: 'ReportUtils'
});
